import React from 'react';
import Footer from './Footer';
import {Celebrating,StorySoFar} from '../util/phrases'
const EverythingAfri = () => {
    const catalog = [
        {
            header:Celebrating,
            content:StorySoFar
        }
    ]
    return(
        <div>
            <div>
                {catalog.map((item,i)=> (
                    <div style={{
                        position:"relative",
                        fontSize:"2vw",
                        fontWeight:"bold",
                        bottom:"20vh"
                    }}>
                        {item.header}
                    </div>
                ))}
            </div>
            <Footer />
        </div>
    )
}

export default EverythingAfri;
